function Logger(t){this.init(t)}Logger.prototype={init:function(t){this.appName=t},logs:[],rotateLimit:100,setRotate:function(t){this.rotateLimit=t},add:function(){if(this.logs.length>this.rotateLimit)for(var t=this.logs.length-this.rotateLimit,o=0;t>=o;o++)this.logs.shift();for(var o=0;arguments.length>o;o++)this.logs.push(arguments);this.print(arguments)},clear:function(){this.logs=[]},show:function(){for(var t=0;this.logs.length>t;t++)this.print.call(this,this.logs[t])},print:function(t){for(var o=[],i=new Date,s=i.getHours()+":"+i.getMinutes()+"."+i.getMilliseconds(),n=0;t.length>n;n++)o.push(t[n]);console.log("[%c"+this.appName+"%c]"+o.join(", ")+" %c("+s+")","color:blue;","color:black;","color:#bbbbbb;")}},console.log("読み込まれています",location.href);